pragma solidity >=0.5.0 <0.6.0;

contract ZombieFactory {

    event NewZombie(uint zombieId, string name, uint dna);
    event NewFriendship(uint zombieId, uint friendId);

    uint dnaDigits = 16;
    uint dnaModulus = 10 ** dnaDigits;

    struct Zombie {
        string name;
        uint dna;
        uint[] friends; // Track the friends of each zombie
    }

    Zombie[] public zombies;

    mapping (uint => address) public zombieToOwner;
    mapping (address => uint) ownerZombieCount;


    //mapping (productId => address[]) predecessors;
    //mapping (productId => address[]) successors;

    //function addProduct(string _name, uint _carbonFootprint, address[] successors, address[] predecessors) public
    //function addLink(address _product1, address _product2) public 
    //function removeLink(address _product1, address _product2) public


    function _createZombie(string memory _name, uint _dna) private {
        uint id = zombies.push(Zombie(_name, _dna, new uint[](0))) - 1;
        zombieToOwner[id] = msg.sender;
        ownerZombieCount[msg.sender]++;
        emit NewZombie(id, _name, _dna);
    }

    function _generateRandomDna(string memory _str) private view returns (uint) {
        uint rand = uint(keccak256(abi.encodePacked(_str)));
        return rand % dnaModulus;
    }

    function createRandomZombie(string memory _name) public {
        uint randDna = _generateRandomDna(_name);
        _createZombie(_name, randDna);
    }

    function addFriend(uint _zombieId, uint _friendId) public {
        require(_zombieId < zombies.length, "Invalid zombieId");
        require(_friendId < zombies.length, "Invalid friendId");

        Zombie storage zombie = zombies[_zombieId];
        zombie.friends.push(_friendId);
        emit NewFriendship(_zombieId, _friendId);
    }
}
